import React from 'react';
import './formulario.css';

const Menu = () => {
  return (
    <menu className="nav">
      <nav >
        <div className="navegador">
          <a href="./index.html">Inicio</a>
          <a href="CrearEvento.html">Eventos</a>
        </div>
      </nav>
    </menu>
  );
};

export default Menu;
